create sequence dbo.seq_product_service;

alter sequence dbo.seq_product_service owner to gesco;



create table if not exists dbo.product_service
(
    id          numeric default nextval('dbo.seq_product_service'::regclass) not null
        constraint product_service_pk
            primary key,
    code        varchar(20),
    name        varchar(100),
    bk_noco     varchar(100),
    bk_psdescri varchar(100),
    bk_pscose   varchar(100),
    bk_psinsel1 varchar(100),
    bk_pscon0   varchar(100),
    bk_pscoicp  varchar(100),
    created_at  timestamp,
    updated_at  timestamp,
    created_by  numeric,
    updated_by  numeric,
    id_state    integer
);

alter table dbo.product_service
    owner to gesco;
	

